import React from "react";
import { NavLink } from "react-router-dom";
import "./navbar.css";

const Navbar = () => {
  return (
    <>
      <header>
        <nav className="main-nav">
          <h2>NFT Marketplace</h2>

          <ul>
            <li>
              <NavLink to="/" activeClassName="navbar__link--active">
                {" "}
                Explore{" "}
              </NavLink>
            </li>

            <li>
              <NavLink to="/popular" activeClassName="navbar__link--active">
                {" "}
                Popular{" "}
              </NavLink>
            </li>

            <li>
              <NavLink to="/sale" activeClassName="navbar__link--active">
                {" "}
                Sale{" "}
              </NavLink>
            </li>

            <li>
              <NavLink to="/collection" activeClassName="navbar__link--active">
                {" "}
                My Collection{" "}
              </NavLink>
            </li>

            <li>
              <NavLink to="/creators" activeClassName="navbar__link--active">
                {" "}
                Creators{" "}
              </NavLink>
            </li>
          </ul>
        </nav>

      <div>
      <NavLink to="/create">
          <button>Create</button>
        </NavLink>
        <button>200 Tokens</button>
      </div>
      </header>
    </>
  );
};

export default Navbar;
